import React from "react";
import {NavLink} from "react-router-dom";


const Menu = () => {
    return (
        <>
        <div className="MenuBox">

        <NavLink to="/" className="a" activeClassName="Menu_part" >Home</NavLink>
        <NavLink to="/about"className="a" activeClassName="Menu_part" >About</NavLink>
        <NavLink to="/service" className="a" activeClassName="Menu_part" >Service</NavLink> 
        <NavLink to="/user" className="a" activeClassName="Menu_part" >User</NavLink>
        
        </div>
        </>
    )
}

export default Menu;
